import React from "react";

function SideBar() {
    return (
          <footer id="footer" class="footer">
            <div class="copyright">
            &copy; Copyright <strong><span>Nextbridge</span></strong>. All Rights Reserved
            </div>
            <div class="credits">
            Designed by <a href="https://presstigers.com/">Presstigers</a>
            </div>
        </footer>
    );
  }

  export default SideBar;
